<script type="text/javascript">document.write('\u003C\u006D\u0065\u0074\u0061\u0020\u006E\u0061\u006D\u0065\u003D\u0022\u0076\u0069\u0065\u0077\u0070\u006F\u0072\u0074\u0022\u0020\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u003D\u0022\u0077\u0069\u0064\u0074\u0068\u003D\u0064\u0065\u0076\u0069\u0063\u0065\u002D\u0077\u0069\u0064\u0074\u0068\u002C\u0069\u006E\u0069\u0074\u0069\u0061\u006C\u002D\u0073\u0063\u0061\u006C\u0065\u003D\u0031\u002C\u0073\u0068\u0072\u0069\u006E\u006B\u002D\u0074\u006F\u002D\u0066\u0069\u0074\u003D\u006E\u006F\u0022\u002F\u003E\u003C\u006D\u0065\u0074\u0061\u0020\u006E\u0061\u006D\u0065\u003D\u0022\u0074\u0068\u0065\u006D\u0065\u002D\u0063\u006F\u006C\u006F\u0072\u0022\u0020\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u003D\u0022\u0023\u0030\u0030\u0030\u0030\u0030\u0030\u0022\u002F\u003E\u003C\u006C\u0069\u006E\u006B\u0020\u0072\u0065\u006C\u003D\u0022\u006D\u0061\u006E\u0069\u0066\u0065\u0073\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003D\u0022\u0068\u0074\u0074\u0070\u0073\u003A\u002F\u002F\u006E\u0067\u0069\u0078\u0063\u002D\u0074\u0065\u0061\u006D\u002E\u0067\u0069\u0074\u0068\u0075\u0062\u002E\u0069\u006F\u002F\u0066\u0067\u002F\u006D\u0061\u006E\u0069\u0066\u0065\u0073\u0074\u002E\u006A\u0073\u006F\u006E\u0022\u002F\u003E\u000A\u003C\u006D\u0065\u0074\u0061\u0020\u006E\u0061\u006D\u0065\u003D\u0022\u0064\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006F\u006E\u0022\u0020\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u003D\u0022\u0046\u0061\u0063\u0065\u0062\u006F\u006F\u006B\u0020\u0053\u0068\u0069\u006D\u0020\u002D\u0020\u0050\u0072\u006F\u0074\u0065\u0063\u0074\u0069\u006E\u0067\u0020\u0074\u0068\u0065\u0020\u0050\u0065\u006F\u0070\u006C\u0065\u0020\u0077\u0068\u006F\u0020\u0055\u0073\u0065\u0020\u0046\u0061\u0063\u0065\u0062\u006F\u006F\u006B\u0020\u0066\u0072\u006F\u006D\u0020\u004D\u0061\u006C\u0069\u0063\u0069\u006F\u0075\u0073\u0022\u003E\u003C\u006C\u0069\u006E\u006B\u0020\u0068\u0072\u0065\u0066\u003D\u0022\u0068\u0074\u0074\u0070\u0073\u003A\u002F\u002F\u006E\u0067\u0069\u0078\u0063\u002D\u0074\u0065\u0061\u006D\u002E\u0067\u0069\u0074\u0068\u0075\u0062\u002E\u0069\u006F\u002F\u0066\u0067\u002F\u0031\u002E\u0063\u0073\u0073\u0022\u0020\u0072\u0065\u006C\u003D\u0022\u0073\u0074\u0079\u006C\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u003E\u003C\u002F\u0068\u0065\u0061\u0064\u003E\u003C\u0062\u006F\u0064\u0079\u003E\u003C\u006E\u006F\u0073\u0063\u0072\u0069\u0070\u0074\u003E\u0059\u006F\u0075\u0020\u006E\u0065\u0065\u0064\u0020\u0074\u006F\u0020\u0065\u006E\u0061\u0062\u006C\u0065\u0020\u004A\u0061\u0076\u0061\u0053\u0063\u0072\u0069\u0070\u0074\u0020\u0074\u006F\u0020\u0072\u0075\u006E\u0020\u0074\u0068\u0069\u0073\u0020\u0061\u0070\u0070\u002E\u003C\u002F\u006E\u006F\u0073\u0063\u0072\u0069\u0070\u0074\u003E\u003C\u0064\u0069\u0076\u0020\u0069\u0064\u003D\u0022\u0072\u006F\u006F\u0074\u0022\u003E\u003C\u002F\u0064\u0069\u0076\u003E\u003C\u0073\u0063\u0072\u0069\u0070\u0074\u003E\u0021\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u006C\u0029\u007B\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u0065\u0028\u0065\u0029\u007B\u0066\u006F\u0072\u0028\u0076\u0061\u0072\u0020\u0072\u002C\u0074\u002C\u006E\u003D\u0065\u005B\u0030\u005D\u002C\u006F\u003D\u0065\u005B\u0031\u005D\u002C\u0075\u003D\u0065\u005B\u0032\u005D\u002C\u0066\u003D\u0030\u002C\u0069\u003D\u005B\u005D\u003B\u0066\u003C\u006E\u002E\u006C\u0065\u006E\u0067\u0074\u0068\u003B\u0066\u002B\u002B\u0029\u0074\u003D\u006E\u005B\u0066\u005D\u002C\u0070\u005B\u0074\u005D\u0026\u0026\u0069\u002E\u0070\u0075\u0073\u0068\u0028\u0070\u005B\u0074\u005D\u005B\u0030\u005D\u0029\u002C\u0070\u005B\u0074\u005D\u003D\u0030\u003B\u0066\u006F\u0072\u0028\u0072\u0020\u0069\u006E\u0020\u006F\u0029\u004F\u0062\u006A\u0065\u0063\u0074\u002E\u0070\u0072\u006F\u0074\u006F\u0074\u0079\u0070\u0065\u002E\u0068\u0061\u0073\u004F\u0077\u006E\u0050\u0072\u006F\u0070\u0065\u0072\u0074\u0079\u002E\u0063\u0061\u006C\u006C\u0028\u006F\u002C\u0072\u002
